astar::PathTracker::<G>::reconstruct_pat:
fn reconstruct_path_to(&self, last: G::NodeId) -> Vec<G::NodeId>{
        let mut path = vec![last];

        let mut current = last;
        while let Some(&previous) = self.came_from.get(&current) {
            path.push(previous);
            current = previous;
        }

        path.reverse();

        path
    }

